                <div className="jumbotron">
                    <h1 className="text-center">View User</h1>
                </div>
                <div className="row">
                    <div className="col-md-6">
                         <button class="btn btn-info" style={{bordeRadius:15}}>View All</button>   
                    </div>
                    <div className="col-md-6">
                        <div class="form-group">
                            <label>User ID:</label>
                            <input type="text" className="form-control"  placeholder="Enter User Id"></input>
                        </div>
                            <button type="submit" class="btn btn-info" style="border-radius:15px;">View By ID</button>

                    </div>
                </div>
                <ViewUsers />
            </div>
        );
    }
}

export default ViewUser;
